    false,nt"url": null,nt"notes": "The station is operated only during the
    breeding season and winter periods, no migration banding is undertaken. This project
    is a program to monitor breeding populations of North American passerines. The data
    collected by the station is also supplied to the Great Dismal Swamp National Wildlife
    Refuge to assist with management programs on the refuge. Banding is carried out
    in an area that represents the predominant habitat type and hopes are to expand
    to other habitats in time. This report outlines the results of the banding efforts
    in 1991.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
